INSERT INTO markers (id, marker, exp_name, info, visiting_id, room_id, model, type_model) VALUES (0, '/static/markers/marker.zpt', 'Байкал', 'По-бурятски это озеро называется Байгаал-далай. Монгольское слово «далай» — «океан», «великий» — указывает и на размеры, и на святость Байкала (по аналогии с далай-ламой). По преданию кабанских бурят, живущих на восточном берегу озера, однажды земля в этом месте содрогнулась, и появилась трещина с пылающим в ней огнем. Боги не вняли молитвам испуганных людей, тогда они воскликнули: «Бай, гал!» — «Огонь, остановись!» Огонь стал затухать. Постепенно трещина заполнилась водой и осталась в памяти народа под именем Байгаал.', 1, 1, '/static/expasition/img_1.png', '2D');
INSERT INTO markers (id, marker, exp_name, info, visiting_id, room_id, model, type_model) VALUES (1, '/static/markers/marker1.zpt', 'Аральская пещера', 'Самый большой грот Байкала находится со стороны моря на мысе Арал на Малом Море, его длина достигает 37 м, ширина до 5 м, высота до 5 м. Вторая пещера-грот расположена на мысе Калтыгей в 1,5 км к северу от пос. Малая Зама. Длина этой пещеры 13 м и ширина около 5 м. Особенно живописный гроты в марте, когда они покрыты ледяным ожерельем. До пещеры около 1 часа ходьбы от Замы.', 2, 1, '/static/expasition/img_2.png', '2D');
INSERT INTO markers (id, marker, exp_name, info, visiting_id, room_id, model, type_model) VALUES (2, '/static/markers/marker2.zpt', 'Нерпа', 'Нерпа – это байкальский эндемик и один из трех видов пресноводных тюленей, которые существуют в мире. Большинство учёных склоняются к мнению, что данные млекопитающие, кстати, как и байкальский омуль, попали в озеро из Северного ледовитого океана в межледниковый период, когда ещё существовал водный путь по руслу нынешних рек Ангара и Енисей. По крайней мере, последние 20 000 лет нерпа существует и эволюционирует обособленно от остальных видов тюленей.', 3, 2, '/static/expasition/statue_2.gltf', '3D');
INSERT INTO markers (id, marker, exp_name, info, visiting_id, room_id, model, type_model) VALUES (3, '/static/markers/marker3.zpt', 'Омуль', 'Принадлежит байкальский омуль к семейству лососевые, роду сиги. Впервые он был описан в 1775 году и получил название «мигрирующий сиг». Данный вид является эндемиком и живёт только в Байкале, потому что этой рыбе нужна вода, богатая кислородом. Тело удлинённой формы, чешуя мелкая, рот конический, челюсти равной длины. Окраска туловища светло-серебристая. Спина темнее боков. Цвет у неё буровато-зелёный с серебристым оттенком. На голове и спинном плавнике имеются тёмные пятна. Средний размер взрослых рыб составляет 37-40 см при все 0,6-0,8 кг.', 4, 2, '/static/expasition/img_4.png', '2D');
INSERT INTO markers (id, marker, exp_name, info, visiting_id, room_id, model, type_model) VALUES (4, '/static/markers/marker4.zpt', 'Ольхонские бурята', 'В состав этнотерриториальной группы ольхонских бурят входили такие малые племена, как шоно, абазай, хамнай, хэнгэлдэр, алагуй, сойод, галзуд, сэгэнуд, хайтал, буян, дурлай, харбяд, нохой, баяндай, булагад. Ольхонские буряты расселены на острове Ольхон и в средней части западного побережья озера Байкал и являются коренным народом Байкала.', 5, 3, '/static/expasition/statue_7.gltf', '3D');
INSERT INTO markers (id, marker, exp_name, info, visiting_id, room_id, model, type_model) VALUES (5, '/static/markers/marker5.zpt', 'PIROMYD_IS_CUMNEY', 'Согласно верованиям бурят, в каждой местности обитают свои духи. Для самых сильных из них сооружают обоо — пирамиду из камней, возле которой совершают жертвоприношения. В качестве жертвы выступают сладости и молочные продукты, монеты, хлеб, завязанные полоски ткани, жгуты благовония.', 6, 3, '/static/expasition/stones.gltf', '3D');
INSERT INTO markers (id, marker, exp_name, info, visiting_id, room_id, model, type_model) VALUES (6, '/static/markers/marker6.zpt', 'SHAMAN_CUMEN', 'Было у старого богатыря Байкала 336 сыновей и единственная дочь Ангара, которую он прятал на морском дне. Когда пришло время Ангаре выйти замуж, отец задумал отдать ее за соседа Иркута. Но чайка, прилетевшая издалека, рассказала девушке про красивого богатыря Енисея, и зажглось сердце Ангары любовью. Она обманула отца, пробила горный хребет и вырвалась из моря. Обнаружив побег, Байкал в ярости кинул вслед дочери скалу, которая стоит у истоков Ангары и которую люди прозвали Шаман-камнем.', 7, 3, '/static/expasition/img_7.png', '2D');
INSERT INTO markers (id, marker, exp_name, info, visiting_id, room_id, model, type_model) VALUES (7, '/static/markers/marker7.zpt', 'Традиционный дом бурят', 'Традиционным жилищем бурят является юрта. Юрты бывают как войлочные, так и в виде сруба из бруса или брёвен, деревянные юрты — шести- или восьмиугольные. Юрты не имеют окон. Перед юртой устраивали коновязь в виде столба с орнаментом. В XIX веке богатые буряты начали строить для жилья избы.', 8, 3, '/static/expasition/statue_5.gltf', '3D');
INSERT INTO markers (id, marker, exp_name, info, visiting_id, room_id, model, type_model) VALUES (8, '/static/markers/marker8.zpt', 'Сувенирная лавка', 'Это сувенирная лавка. Здесь можно купить различные сувениры', NULL, NULL, NULL, NULL);
INSERT INTO markers (id, marker, exp_name, info, visiting_id, room_id, model, type_model) VALUES (9, '/static/markers/marker9.zpt', 'Начальная позиция', 'Начальная позиция. Выберите маршрут и следуйте ему!', NULL, NULL, NULL, NULL);
